                complete: false,
            },
            {
                id: 6,
                coordinates: [51.523265, -2.578649],
                title: 'QUIZ TIME!',
                description: "Do you want to play with me and earn some points?",
                complete: false,
            },
            {
                id: 7,
                coordinates: [51.523176, -2.578409],
                title: 'QUIZ TIME!',
                description: "Do you want to play with me and earn some points?",
                complete: false,
            },
            {
                id: 8,
                coordinates: [51.523076, -2.578259],
                title: 'QUIZ TIME!',
                description: "Do you want to play with me and earn some points?",
                complete: false,
            },
            {
                id: 9,
                coordinates: [51.522776, -2.579259],
                title: 'QUIZ TIME!',
                description: "Do you want to play with me and earn some points?",
                complete: false,
            },
        ],

        Fact: [
            {
                id: 1,
                coordinates: [51.523226, -2.578289],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 2,
                coordinates: [51.523265, -2.577975],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 3,
                coordinates: [51.523405, -2.578095],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 4,
                coordinates: [51.523485, -2.578159],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 5,
                coordinates: [51.523425, -2.578509],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 6,
                coordinates: [51.523315, -2.578549],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 7,
                coordinates: [51.523116, -2.578329],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 8,
                coordinates: [51.523066, -2.578419],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
            {
                id: 9,
                coordinates: [51.522756, -2.579059],
                title: "FACT TIME!",
                description: "Do you want to learn with me and earn some points?",
                complete: false
            },
        ],

        Game: [
            {
                id: 1,
                coordinates: [51.523213, -2.578062],
                description: "Let's Play!",
                complete: false
            }
        ],

        Picture: [
            {
                id: 1,
                coordinates: [51.523273, -2.578122],
                description: "Snap a Photo!",
                complete: false
            }
        ],

        Sections: [
            {
                era: 1,
                complete: false,
                quiz: {
                    id: 1,
                    coordinates: [51.523176, -2.578209],
                    title: 'QUIZ TIME!',
                    description: "Do you want to play with me and earn some points?",
                    complete: false,
                },
                fact: {
                    id: 1,
                    coordinates: [51.523226, -2.578289],
                    title: "FACT TIME!",
                    description: "Do you want to learn with me and earn some points?",
                    complete: false
                }
            },
            {
                era: 2,
                complete: false
            },
            {
                era: 3,
                complete: false
            },
            {
                era: 4,
                complete: false
