                                    className="basic-btn fact-btn"
                                    onClick={() => {selectedInteraction.complete = true }}
                                >
                                    <h3>{ selectedInteraction.description }</h3>
                                </Link>
                            </div>
                        </InfoWindow>
                    </div>
                )
            }

        </GoogleMap>
    )
}

